    X.remove(X[0]) # удаляем первый бит
    if statistic_check(X,z) < 73:
        temp = list.copy(L1)
        good_massive_L1.append(temp)
        frequency.append(statistic_check(X,z))
    L1 = list.copy(X[0:25])  # новый смещенный регистр L1
    #print(statistic_check(X,z))
    return L1,X,frequency

